        <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.6.4/jquery.min.js"></script>
        <script>
          var sectorList={
            1:{title:'Bronze',color:"#CD7F32" },
            2:'silver',
            3:'gold',
            4:'platinum'
          }
          
          var array=[]
          var ticketArray=[]
          $('svg path').on('click',async function(e){
            if(!$(this).attr("data-booked")){
            $('#clickInfo').css("display", 'flex')
            let secId
            switch (this.id.split('-')[0]) {
                case 'bronze':
                  secId =  1
                  break;
                case 'silver':
                secId =  2
                  break;
                case 'gold':
                secId =  3
                  break;
                case 'platinum':
                secId =  4
                  break;
                default:
                  break;
              }
            var result = await array.find(obj => {
              return obj.col == this.id.split('-')[2] && obj.row ==this.id.split('-')[1] && obj.active==true && obj.sectorId==secId
            })
            ticketArray.push(result)
            $('#ticketArray').empty()
            let price=0
            for(let ticket of ticketArray){
              $('#ticketArray').append(`
              <div class="ticket border border-primary p-2 rounded">
                <div class="text-sm">Сектор: ${sectorList[ticket.sectorId].title}</div>
               
                <div class="opacity-70 ">Место:  ${ticket.col}</div>
                <div class="opacity-70 ">Ряд: ${ticket.row}</div>\n
                    ${ticket.price} рублей
                
                  
                </div>
              `)
              price+=parseInt(ticket.price)
            }
            $('#totalPrice').text(price)
            }
          })
        $('svg path').mouseover(async function(e) {
          if(!$(this).attr("data-booked")){
          var pos = this.getBoundingClientRect();
          var ratio = window.devicePixelRatio || 1;
          var w = screen.width
          var h = screen.height 
          if(w>750){
          var boxPos = document.getElementById('hoverInfo').getBoundingClientRect()
            $('#hoverInfo').css("top", pos.top-boxPos.height).css('left', (pos.left+(pos.width/2)-(boxPos.width/2)))
            
          }else{
            $('#hoverInfo').css('position', 'fixed').css("bottom", window.visualViewport.offsetBottom).css('left', window.visualViewport.offsetLeft).css('right', window.visualViewport.offsetRight).css('width', w/window.visualViewport.width)
            $('#container').css("width", window.visualViewport.width).css("font-size", $('#container').css('font-szie')/window.visualViewport.scale)
          }
          $('#hoverInfo').css("display", 'block')
            let secId
            switch (this.id.split('-')[0]) {
                case 'bronze':
                  secId =  1
                  break;
                case 'silver':
                secId =  2
                  break;
                case 'gold':
                secId =  3
                  break;
                case 'platinum':
                secId =  4
                  break;
                default:
                  break;
              }
            var result = await array.find(obj => {
              return obj.col == this.id.split('-')[2] && obj.row ==this.id.split('-')[1] && obj.active==true && obj.sectorId==secId
            })
            if(result){
              let price='-'
              let status =''
              let  color="#1cda07"
              let spanColor='#000'
              let sector = ''
              switch (result.sectorId) {
                case 1:
                  sector =  'Bronze'
                  spanColor='#CD7F32'
                  break;
                case 2:
                  sector =  'Silver'
                  spanColor='#C0C0C0'
                  break;
                case 3:
                  sector =  'Gold'
                  spanColor='#DAA520'
                  break;
                case 4:
                  sector =  'Platinum'
                  spanColor='#E5E4E2'
                  break;
                default:
                  break;
              }
              switch (parseInt(result.statusId)) {
                case 1:
                status = 'Свободно'
                price=result.price
                  break;
                case 2:
                status = 'Ожидает рассмотрения'
                  break;
                case 3:
                status = 'Занято'
                  break;
                
                default:
                  break;
              }
          
              $('#priceText').text(price)
              $('#sectorText').text(sector).css('color', spanColor)
              $('#statusText').text(status)
              $('#statusText').css('color', color)
              $('#colText').text(result.col)
              $('#rowText').text(result.row)
          }
        }
          });
        fetch('/api/seat').then(async(res)=>{
            array=await res.json()
            for(let seat of array){
                let sector=''
                switch (seat.sectorId) {
                case 1:
                  sector='bronze'
                 
                  break;
                case 2:
                  sector='silver'
                  break;
                case 3:
                  sector='gold'
                  break;
                case 4:
                  sector='platinum'
                  break;
                default:
                  break;
              }
                if(seat.statusId!=1){
                    $('#'+sector+'-'+seat.row+'-'+seat.col).attr("fill", "rgba(207,207,207,0.5)" )
                    $('#'+sector+'-'+seat.row+'-'+seat.col).attr("opacity", "0.3" )
                    $('#'+sector+'-'+seat.row+'-'+seat.col).attr("data-booked",  true)
                   //await  $('#'+sector+'-'+seat.row+'-'+seat.col).css("fill", color )
            
                }
               
            }
        })
        </script>
